import logo from './logo.svg';
import './App.css';

function App() {
let ans;
  function calculate(a, b) {
    const add = a + b;
    const subtract = a - b;
    const multiply = a * b;
    const divide = a / b;

    ans=[add, subtract, multiply, divide];
  }

  return (
    <div className="App">
<input type="number" placeholder='number 1' />
<input type="number" placeholder='number 2' />
<p>The value = {}</p>
<button onClick={calculate} style={{width:'50px',height:'50px',margin:'5px'}}><h3>+</h3></button>
<button onClick={calculate} style={{width:'50px',height:'50px',margin:'5px'}}><h3>-</h3></button>
<button onClick={calculate} style={{width:'50px',height:'50px',margin:'5px'}}><h3>*</h3></button>
<button onClick={calculate} style={{width:'50px',height:'50px',margin:'5px'}}><h3>/</h3></button>
    </div>
  );
}

export default App;
